E_D("replace into `phome_ecms_game` values('812','5','0','','','','1','admin','','1','0','1343189806','0','0','0','0','','','812','0','0','0','0','0','0','宝莲灯','1343189806','/spic/20120725/612.jpg','0','1','1343189806','0','3','1','0','','0','','','667','479','    宝莲灯动画电影讲述了：天宫中的三圣母爱上了人间书生刘彦昌，为了爱情她不顾二郎神反对带着宝莲灯私奔下凡。为了维护天规，二郎神抓走了小沉香，要挟三圣母交出宝莲灯。无奈之中，三圣母只得把灯交出，并被压在华山底下。沉香从土地神口中得知了自己的身世，踏上了寻母之路……','1','','0','','1','/dpic/20120725/613.jpg','321','/donghuapian/321/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/06/138.jpg','http://www.61baobao.com/donghuapian/pic/06/138.jpg','0','三个月以上','1','cntv,DDCDCA4F35F646918623D81BD0F9DB3C|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('813','5','0','','','','1','admin','|43|','1','0','1343189807','0','0','0','0','','','813','0','0','0','0','0','0','少年大钦差','1343189807','/spic/20120725/594.jpg','0','1','1343973115','0','3','1','0','','1','','','667','479','《少年大钦差》讲述的是天才儿童陈文杰智斗和申、惩处贪官、为民请命的故事，剧中的陈文杰最初是一个骄傲自负的天才儿童，经历了诸多“挫折教育”之后，成长为一个机智勇敢的大钦差。因为有了曾志伟、吴孟达、张默和小叮当这老老小小四大喜剧天才的加入，使该剧变得幽默搞笑，但轻松过后传达给少年儿童的是一种健康正面、积极向上的精神内涵，加强他们的磨练意识，培养他们辨别是非的能力、对挫折的承受能力。<br />','1','','0','','1','/dpic/20120725/595.jpg','228','/donghuapian/228/1.html, /donghuapian/228/2.html, /donghuapian/228/3.html, /donghuapian/228/4.html, /donghuapian/228/5.html, /donghuapian/228/6.html, /donghuapian/228/7.html, /donghuapian/228/8.html, /donghuapian/228/9.html, /donghuapian/228/10.html, /donghuapian/228/11.html, /donghuapian/228/12.html, /donghuapian/228/13.html, /donghuapian/228/14.html, /donghuapian/228/15.html, /donghuapian/228/16.html, /donghuapian/228/17.html, /donghuapian/228/18.html, /donghuapian/228/19.html, /donghuapian/228/20.html, /donghuapian/228/21.html, /donghuapian/228/22.html, /donghuapian/228/23.html, /donghuapian/228/24.html, /donghuapian/228/25.html, /donghuapian/228/26.html, /donghuapian/228/27.html, /donghuapian/228/28.html, /donghuapian/228/29.html, /donghuapian/228/30.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/06/044.jpg','http://www.61baobao.com/donghuapian/pic/06/044.jpg','0','三个月以上','30','youku,31457186|||youku,31456228|||youku,31456262|||youku,31456302|||youku,31456337|||sohu,204577|||sohu,204669|||sohu,204673|||sohu,204701|||sohu,204761|||sohu,204769|||sohu,204815|||sohu,204831|||sohu,204840|||sohu,204849|||sohu,204912|||sohu,204924|||sohu,204927|||sohu,204932|||sohu,204936|||sohu,204767|||sohu,204779|||sohu,204786|||sohu,204789|||sohu,204796|||sohu,204799|||sohu,204801|||sohu,204803|||sohu,204809|||sohu,204817|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('814','5','0','','','','1','admin','','1','0','1343189807','0','0','0','0','','','814','0','0','0','0','0','0','神笔马良','1343189807','/spic/20120725/632.jpg','0','1','1343189807','0','3','1','0','','0','','','667','479','从前，有个孩子名字叫马良。他的父亲母亲死的早，他就靠自己打柴、割草过日子。他从小喜欢学画，可是，他连一支笔也没有啊！一天，他走过一个学馆门口，看见学馆里的教师，拿着一支笔，正在画画。他不自觉地走了进去，对教师说：“我很想学画，借给我一支笔可以吗？” 教师瞪了他一眼，“呸！”一口唾沫啐在他脸上，骂道：“穷娃子想拿笔，还想学画？做梦啦！”说完，就将他撵出大门来。马良是个有志气的孩子，他说：“偏不相信，怎么穷孩子连画也不能学了！”从此，他下决心学画，每天用心苦练。他到山上打柴时，就折一根树枝，在沙地上学着描飞鸟。他到河边割草时，就用草根蘸蘸河水，在岸石上学着描游鱼。晚上，回到家里，拿了一块木炭，在窑洞的壁上，又把白天描过的东西，一件一件再画一遍。没有笔，他照样学画画。','1','','0','','1','/dpic/20120725/633.jpg','600','/donghuapian/600/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0214.jpg','http://www.61baobao.com/donghuapian/pic/05/0214.jpg','0','三个月以上','1','qiyi,250a6366918849a486adc1cb1ffbb8a7|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('815','5','0','','','','1','admin','','1','0','1343189810','0','0','0','0','','','815','0','0','0','0','0','0','正义小兔警','1343189810','/spic/20120725/616.jpg','0','1','1343189810','0','3','1','0','','0','','','667','479','正义小兔警讲述的是公元3300年，兔兔家族已经发展成为了一个很强大的兔兔国。他们在过着自由自在的生活。但海对面的野猪岛国却对兔兔国落垂涎三尺。野猪国的鲨德斯将军是一只一心想用武力称霸全球，忒有理想的野猪。目前他首先的任务就是征服住对面的那一群兔，侵占他们居住的地方。','1','','0','','1','/dpic/20120725/617.jpg','510','/donghuapian/510/1.html, /donghuapian/510/2.html, /donghuapian/510/3.html, /donghuapian/510/4.html, /donghuapian/510/5.html, /donghuapian/510/6.html, /donghuapian/510/7.html, /donghuapian/510/8.html, /donghuapian/510/9.html, /donghuapian/510/10.html, /donghuapian/510/11.html, /donghuapian/510/12.html, /donghuapian/510/13.html, /donghuapian/510/14.html, /donghuapian/510/15.html, /donghuapian/510/16.html, /donghuapian/510/17.html, /donghuapian/510/18.html, /donghuapian/510/19.html, /donghuapian/510/20.html, /donghuapian/510/21.html, /donghuapian/510/22.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0153.jpg','http://www.61baobao.com/donghuapian/pic/05/0153.jpg','0','三个月以上','22','cntv,71ef10a6a1ed43fb99ae673d56108cca|||cntv,aee685626316474488d5a76636d076ea|||cntv,2a3ea3938051450b8d25b4decb68eb15|||cntv,4366bbf6977e46fa9e41eb64e3809784|||cntv,84825725bee1484992599dda902c9991|||cntv,196d1b136aff4efba3649c75ccdbcb47|||cntv,fcb878e754874b999d949418df1f9f32|||cntv,faaa5dab2400489a99766e36fc755dbe|||cntv,72c400a02408407e96c71bdc7f9ac004|||cntv,a3fb2e5071a64ffd9cb9cefbe55d03af|||cntv,a653edbcb31a4f1baf7992feb0636b47|||cntv,cb74ce84cef54cb4b983619713251990|||cntv,3fa287d04a4e4fca9e983c7fc21c8316|||cntv,7c91e365017941c89c5ee23de2a7acec|||cntv,a5a463c4341847c2a5dbb00d34dbf62a|||cntv,deef374940e448bd99cb8dbbf4c35e95|||cntv,fb16d1579c104c278806e9b362d23555|||cntv,c3074b0abc924569b6dae9c347b853ff|||cntv,405f39f1c167437493d0cd04caa0cf45|||cntv,adfa1c60751242f4a945fe2551242b59|||cntv,29f66104ce6b4b19b61a47b34d638dc8|||cntv,8d24f