E_D("replace into `phome_ecms_game` values('816','5','0','','','','1','admin','','1','0','1343189810','0','0','0','0','','','816','0','0','0','0','0','0','美食总动员','1343189810','/spic/20120725/636.jpg','0','1','1343189810','0','3','1','0','','0','','','667','479',' 动画片美食总动员是迪斯尼与皮克斯双剑合璧的动画巨制。如今合而为一的两动画巨头，打起了一只名叫“蔬菜杂烩”的小老鼠的主意。皮克斯的三维技术别家公司绝对望尘莫及，而以制作过《超人总动员》的幕后导演布拉德?伯德率领的团队，创意更是顶尖！讲述可爱小老鼠有着大智慧的故事，美食+可爱动物+梦想无敌。','1','','0','','1','/dpic/20120725/637.jpg','702','/donghuapian/702/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/07/02.jpg','http://www.61baobao.com/donghuapian/pic/07/02.jpg','0','三个月以上','1','cntv,cf9a1dbfa1be4883b5d8c55ca11cc634|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('817','5','0','','','','1','admin','','1','0','1343189811','0','0','0','0','','','817','0','0','0','0','0','0','萝卜回来了','1343189811','/spic/20120725/596.jpg','0','1','1343189811','0','3','1','0','','0','','','667','479','冬天，小白兔在雪地里找到两个萝卜，自己吃了一个小的，决定把大的送给小鹿。小鹿不在家，小白兔把萝卜放下就走了。小鹿回家看见桌上放着一个大萝卜，感到很奇怪，刚想吃时，想到小熊可能没有东西吃，就抱着萝卜来到小熊家，小熊出去了，它就把萝卜放在小熊的床上。小熊回来见到它最爱吃的萝卜，高兴得又蹦又跳。忽然，它从窗户里看到小猴的家。心想，天这么冷，小猴也许找不到吃的东西，就把萝卜送到小猴家，小猴也不在家，小熊便坐在门口等，等了好久就睡着了。小猴回来见小熊坐在门口打盹，就去逗它。小熊醒后，说是送萝卜来的，小猴不肯接受，它俩推来推去，最后决定把萝卜送给小白兔。小白兔一看，这就是自己送给小鹿的那个大萝卜，萝卜又回来了。于是它建议，请小鹿也来，把大萝卜切成四块，四个好朋友一起吃。大家团聚在一起，唱起欢乐的歌。 ','1','','0','','1','/dpic/20120725/597.jpg','602','/donghuapian/602/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0216.jpg','http://www.61baobao.com/donghuapian/pic/05/0216.jpg','0','三个月以上','1','qiyi,4f6067b3906040279e488550ba8ab576|||','0','','0','0','0');");
