E_D("replace into `phome_ecms_game` values('827','5','0','','','','1','admin','','1','0','1343189822','0','0','0','1','','','827','0','0','0','0','0','0','东郭先生和狼','1343189822','/spic/20120725/610.jpg','0','1','1343189822','0','3','1','0','','0','','','667','479',' 晋国大夫赵简子率领众随从到中山去打猎，途中遇见一只像人一样直立的狼狂叫着挡住了去路。赵简子立即拉弓搭箭，只听得弦响狼嚎，飞箭射穿了狼的前腿。那狼中箭不死、落荒而逃，使赵简子非常恼怒。他驾起猎车穷追不舍，车马扬起的尘土遮天蔽日。这时候，东郭先生正站在驮着一大袋书简的毛驴旁边向四处张望。原来，他前往中山国求官，走到这里迷了路。正当他面对岔路犹豫不决的时候，突然窜出了一只狼。那狼哀怜地对他说：“现在我遇难了，请赶快把我藏进你的那条口袋吧！如果我能够活命，今后一定会报答您。” ','1','','0','','1','/dpic/20120725/611.jpg','605','/donghuapian/605/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0219.jpg','http://www.61baobao.com/donghuapian/pic/05/0219.jpg','0','三个月以上','1','qiyi,5b1144306b1f4524b06cd67e530621ad|||','0','','0','0','0');");
