E_D("replace into `phome_ecms_game` values('842','5','0','','','','1','admin','','1','0','1343189867','0','0','0','0','','','842','0','0','0','0','0','0','新星小镇','1343189867','/spic/20120725/664.jpg','0','1','1343189867','0','3','1','0','','0','','','667','479','剧中的“新星小镇”是一个居住着各种可爱动物的现代社区，小镇有自己的住宅区、警察局、学校、医院、电视台、镇政府等各种机构，它就像一个现代社会的缩影，生活在小镇里的狗、鳄鱼、猪三个家庭代表着现代社会中普通的有儿女的家庭，这些家庭平凡却又有各自的特色，各自的故事。狗一家比较喧闹，笑料百出；鳄鱼一家性格相对沉静，但也有自己的冷幽默；猪一家憨厚耿直，是介于狗家和鳄鱼家之间的另外一种类型，三个家庭彼此独立而又紧密相连，三家的小孩个性十足而又亲密无间。','1','','0','','1','/dpic/20120725/665.jpg','619','/donghuapian/619/1.html, /donghuapian/619/2.html, /donghuapian/619/3.html, /donghuapian/619/4.html, /donghuapian/619/5.html, /donghuapian/619/6.html, /donghuapian/619/7.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0233.jpg','http://www.61baobao.com/donghuapian/pic/05/0233.jpg','0','三个月以上','7','qiyi,ef6754bcd6bb4e4184b208029a3e2cc9|||qiyi,5dc74155ba3c432b9946a96d5e7a3693|||qiyi,a485dd3df6974d199b5822727c0971dc|||qiyi,a896ee78a60a4885ab0640062f1c68bd|||qiyi,7022e1e3da5d432c918a64b628aed65d|||qiyi,21e76abdc1c7459ead8da0854530471a|||qiyi,a0b509a6aa4b403fa1c4b6a2c6531ee6|||','0','','0','0','0');");
