E_D("replace into `phome_ecms_game` values('885','5','0','','','','1','admin','','1','0','1343189949','0','0','0','0','','','885','0','0','0','0','0','0','童趣','1343189949','/spic/20120725/720.jpg','0','1','1343189949','0','3','1','0','','0','','','667','479','故事灵感来源于中学教材中一幅幅活灵活现的插图。意于通过乡间儿童骑木马、放风筝、踢踺子等一连串美好的嬉戏游戏反应出无忧无虑的童年生活。《童趣》中利用了三维技术将图中清新明快的中国画效果以动态的方式上演于屏幕，更活泼真实的重现了纯真童年的一些趣事。内容生动简洁，意境优美。整个故事情节充满浓浓的中国味，通过故事让生活于钢筋水泥中的青少年儿童以更有乐趣的方式来了解中国传统。','1','','0','','1','/dpic/20120725/721.jpg','156','/donghuapian/156/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/148.jpg','http://www.61baobao.com/donghuapian/pic/148.jpg','0','三个月以上','1','sohu,68674|||','0','','0','0','0');");
