E_D("replace into `phome_ecms_game` values('889','5','1','','','','1','admin','','1','0','1343189953','0','0','0','1','','','889','0','0','0','0','0','0','魔神坛斗士','1343189953','/spic/20120725/748.jpg','0','1','1343189953','0','3','1','0','','0','','','667','479','    在很久很久以前，那是个极富传奇色彩的时代。罪恶的势力在世界上横行霸道，在人民要求和平和拯救的祈祷声中，一位神斗士出现了。据传说，这位斗士身穿金光闪闪的盔甲，他将恶魔们赶了出去。然而，恶魔们又卷土重来，企图建立起庞大的仇恨王国。他们发动了一场战争，企图控制人类世界。他们利用各自的魔力大肆淫威，人类的抵抗对他们毫无威胁。然而，有五位青年身穿神盔甲，与阿罗醐的妖邪世界展开了殊死的搏斗，他们就是——魔神坛斗士。','1','','0','','1','/dpic/20120725/749.jpg','224','/donghuapian/224/1.html, /donghuapian/224/2.html, /donghuapian/224/3.html, /donghuapian/224/4.html, /donghuapian/224/5.html, /donghuapian/224/6.html, /donghuapian/224/7.html, /donghuapian/224/8.html, /donghuapian/224/9.html, /donghuapian/224/10.html, /donghuapian/224/11.html, /donghuapian/224/12.html, /donghuapian/224/13.html, /donghuapian/224/14.html, /donghuapian/224/15.html, /donghuapian/224/16.html, /donghuapian/224/17.html, /donghuapian/224/18.html, /donghuapian/224/19.html, /donghuapian/224/20.html, /donghuapian/224/21.html, /donghuapian/224/22.html,','1','0','','http://www.61baobao.com/donghuapian/dpic/06/042.jpg','http://www.61baobao.com/donghuapian/pic/06/042.jpg','0','三个月以上','22','youku,28784647|||youku,28784896|||youku,28784918|||youku,28784944|||youku,28784966|||youku,28807307|||youku,28807352|||youku,28807739|||youku,28811011|||youku,28811440|||youku,28813051|||youku,28922262|||youku,28922358|||youku,28923415|||youku,28923432|||youku,28923442|||youku,28923455|||youku,28924255|||youku,28924255|||youku,28924263|||youku,28924284|||youku,28978162|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('890','5','0','','','','1','admin','','1','0','1343189954','0','0','0','0','','','890','0','0','0','0','0','0','名侦探柯南-第11个前锋','1343189954','/spic/20120725/726.jpg','0','1','1343189954','0','3','1','0','','0','','','667','479','毛利侦探事务所突然接到一通威胁电话。之后，路上的汽车就在小五郎的眼前爆炸了！“蓝色的少年与蓝色的斑马，从天而降的雨……”根据犯人寄来的挑战书，若不能解读谜之暗号，便无法阻止接下来的爆炸。小五郎和兰在米花市内来回奔走，却完全找不到破解暗号的方法。另一方面，此时的江户川柯南与灰原和少年侦探团一起，沉浸在观看最爱的足球比赛的快乐之中。正当比赛渐入佳境之时，从兰打来的电话那里，柯南得知了威胁电话的事情。柯南为了解读暗号独自一人离开赛场，却得知了无人能够阻止的恐怖事实……','1','','0','','1','/dpic/20120725/727.jpg','727','/donghuapian/727/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/07/026.jpg','http://www.61baobao.com/donghuapian/pic/07/026.jpg','0','三个月以上','1','cntv,f4cc54cd53d34b18b50a4030e139894b|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('891','5','0','','','','1','admin','','1','0','1343189957','0','0','0','0','','','891','0','0','0','0','0','0','张小盒动画','1343189957','/spic/20120725/758.jpg','0','1','1343189957','0','3','1','0','','0','','','667','479','办公楼是盒子，办公室也是盒子，家也是盒子，中午吃的也是盒饭，车、电梯、文件、桌子、椅子、书等一切一切都是盒子，一个盒子套着一个盒子。因为，每个人都在一个又一个盒子里生存，移动，所以，人也变成了盒子。这就是我们的盒子世界，外面的人都想进来，可是里面的人都想出去。张小盒是我们盒子世界的一员，代表的是每一个本土的普通上班族白领。他个性纯朴，擅长加班，没有车，没有房，没有钱，没有女朋友，被老板压榨，还经常被同事欺负。但他却依然有着自己的理想，坚强乐观的生活着。现实中几乎每一个人都可以在张小盒身上找到自己的影子。所以在我们创作这部漫画的时候非常容易就可以引发观众的共鸣，并且引导着观众在调侃生活的同时苦中作乐，鼓励他们打开自己的盒子，找到属于自己的幸福。','1','','0','','1','/dpic/20120725/759.jpg','553','/donghuapian/553/1.html, /donghuapian/553/2.html, /donghuapian/553/3.html, /donghuapian/553/4.html, /donghuapian/553/5.html, /donghuapian/553/6.html, /donghuapian/553/7.html, /donghuapian/553/8.html, /donghuapian/553/9.html, /donghuapian/553/10.html, /donghuapian/553/11.html, /donghuapian/553/12.html, /donghuapian/553/13.html, /donghuapian/553/14.html, /donghuapian/553/15.html, /donghuapian/553/16.html, /donghuapian/553/17.html, /donghuapian/553/18.html, /donghuapian/553/19.html, /donghuapian/553/20.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0167.jpg','http://www.61baobao.com/donghuapian/pic/05/0167.jpg','0','三个月以上','20','qiyi,07959a395cf7408693da086e6a5bbf33|||qiyi,7e6fbfe287344c8fbaba7047fecbf81a|||qiyi,f9f2d133256848dcae160170585c4d29|||qiyi,763bfad74b3447238998227af4640dad|||qiyi,154794a920d44016935e1552f3ac0e60|||qiyi,ccb0d25af0b347a5a62c195c293c4ccd|||qiyi,71d19fcddc5146faa767f1dbb1f0c809|||qiyi,d11393a932994a3580a7f4dab4301f73|||qiyi,a8811bca8e674d26a50a1bd967f30b25|||qiyi,fb6954b58aad4430859776e052f0aaff|||qiyi,abecd32576bb4a82986efcb0d03ffde3|||qiyi,9c1b8d1ec09f40d6a2198614a16017f2|||qiyi,60d16e6e4fb24e4181b562304a4743e3|||qiyi,5974a5b3a2d54349a87a7985795f9852|||qiyi,df07c1ad782c4555a286099feb244a38|||qiyi,f4cabd3d139f47bc9905af9b831c2d9e|||qiyi,6845f04cbcd04d8f82ea35e58d93dd80|||qiyi,d0ce21032d73476b92c1706e0