E_D("replace into `phome_ecms_game` values('894','5','0','','','','1','admin','','1','0','1343189961','0','0','0','0','','','894','0','0','0','0','0','0','三毛流浪记','1343189961','/spic/20120725/730.jpg','0','1','1343189961','0','3','1','0','','0','','','667','479','三毛流浪记动画片讲述了：讲述了孤儿三毛的辛酸遭遇。在解放前的上海，三毛没有家，无家可归，衣食无着。吃贴广告用的浆糊，睡在垃圾车里。为了生存，他卖过报，拾过烟头，帮别人推黄包车，但总是受人欺侮，但他挣到的钱连吃顿饱饭都不够。只有与他命运相同的流浪儿关心他，给他温暖。','1','','0','','1','/dpic/20120725/731.jpg','465','/donghuapian/465/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0109.jpg','http://www.61baobao.com/donghuapian/pic/05/0109.jpg','0','三个月以上','1','cntv,E4A8D2F50CCF4ee18952E96BB21D4608|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('895','5','0','','','','1','admin','','1','0','1343189963','0','0','0','0','','','895','0','0','0','0','0','0','草莓乐园','1343189963','/spic/20120725/762.jpg','0','1','1343189963','0','3','1','0','','0','','','667','479','风光秀美的大草原有一片郁郁葱葱的草莓林，森林深处有一座美丽的草莓乐园，那里生活着一群活泼可爱的小朋友——有细心敏感但不娇气的小兔、淘气顽皮幼稚可爱的小狼、活泼好动爱出风头的小青蛙、诚实可爱却爱哭鼻子的蜗牛、诚实憨厚胆小怕事的小象……这些小朋友性格迥异，生性善良。于是，教室里，操场上，山坡下，池塘边，都留下了小朋友们顽皮的身影，回荡着她们的笑声……有令人捧腹的搞笑故事，有小动物们打开智慧之门战胜困难的故事，更有充满惊险与刺激的冒险旅程。小朋友们在她们的乐园演绎着绚丽多彩的童年幻想，勾勒着温馨迷人的童年故事。无论清晨、白天，还是黄昏、夜晚，时时刻刻发生着妙趣横生、令人啼笑皆非的故事。365集《草莓乐园》将带你一同回到美好的童年时光，让你有一次心灵的互动。','1','','0','','1','/dpic/20120725/763.jpg','628','/donghuapian/628/1.html, /donghuapian/628/2.html, /donghuapian/628/3.html, /donghuapian/628/4.html, /donghuapian/628/5.html, /donghuapian/628/6.html, /donghuapian/628/7.html, /donghuapian/628/8.html, /donghuapian/628/9.html, /donghuapian/628/10.html, /donghuapian/628/11.html, /donghuapian/628/12.html, /donghuapian/628/13.html, /donghuapian/628/14.html, /donghuapian/628/15.html, /donghuapian/628/16.html, /donghuapian/628/17.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0242.jpg','http://www.61baobao.com/donghuapian/pic/05/0242.jpg','0','三个月以上','17','qiyi,3edeaa1064fa4ae6bfb539f0e80c19e0|||qiyi,f4d88383eff840ffae67f9d83590cc1d|||qiyi,3965ae82ed904b0187c4de4b1dae4ff2|||qiyi,6b9caeabc8f54ce49e70130884842b82|||qiyi,55a6e19436e547c59333edccb0c0f8f7|||qiyi,c822da02a9f54480b19509d61dc8af38|||qiyi,19a7128fb1284a459d554df99aeb98a5|||qiyi,a5b4e1b77cf04fc09250d0969a5fcd75|||qiyi,24fe2ae631cf4ba295ab46c1918ba0e9|||qiyi,bdb111e980c747399914710859d0c5d8|||qiyi,3f07b62d5820466c994c52cd73821c6d|||qiyi,24568482a36e451899c721dd3393bd57|||qiyi,eae52b500bbc40ecaaabcfb43076ed19|||qiyi,8268b856946f49199a7554bafe0f3953|||qiyi,772feb5e5c08418882c8dc8bca8f49f8|||qiyi,2631bbf268834aa4be54bbd4576a7eea|||qiyi,88ae30b48fc4441aa27dfdcd62dfa8c1|||','0','','0','0','0');");
