E_D("replace into `phome_ecms_game` values('907','5','0','','','','1','admin','','1','0','1343189991','0','0','0','0','','','907','0','0','0','0','0','0','老狼请客','1343189991','/spic/20120725/778.jpg','0','1','1343189991','0','3','1','0','','0','','','667','479','一天，老狼捉到两只鸡，兴冲冲地担回家。老狼把鸡煮在锅里，就去请老熊一起来品尝美味。哪知他刚出门，在一旁窥伺已久的狐狸却趁机溜进去把鸡都偷吃了。狐狸从老狼家溜出后，却在老熊面前装成可怜的受害者，并挑拨离间，对老熊说：“老狼正在家里磨刀，准是要割你的耳朵！”老熊潜至窗外，看见老狼真的在磨刀，信以为真，吓得拔腿就跑。<br />','1','','0','','1','/dpic/20120725/779.jpg','446','/donghuapian/446/1.html, /donghuapian/446/2.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/095.jpg','http://www.61baobao.com/donghuapian/pic/05/095.jpg','0','三个月以上','2','cntv,9660e15f2ccc48b84f8421bb18decdc5|||cntv,fe704b78901f4af215f830ae8cc859b2|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('908','5','0','','','','1','admin','','1','0','1343189992','0','0','0','0','','','908','0','0','0','0','0','0','绿野仙踪','1343189992','/spic/20120725/798.jpg','0','1','1343189992','0','3','1','0','','0','','','667','479','小女孩桃乐丝因为与收养她的婶婶顶嘴，独自外出，结果被龙卷风刮到一个鲜花盛开的小人国。在仙女和人们的帮助下，她沿着黄砖路到绿水晶城去找大魔法师寻找回家的办法。路上，她遇见了稻草人、锡皮人和胆小的狮子。稻草人想找魔法师要头脑、锡皮人想要一颗心、胆小的狮子想要胆，于是他们结伴而行。一路上他们战胜了女巫婆的阻挠，终于来到水晶城。但他们发现法力无边的魔法师不过是一个同样被龙卷风刮来的魔术师，根本没有什么法力。正当他们失望的时候，魔术师却用意想不到的方法使他们一一实现了愿望。桃乐丝终于回到了婶婶和叔叔们身边。这部电影情节动人，旋律优美，意义深远。其主题曲“彩虹曲”多年来传唱不休。在第十二届奥斯卡颁奖典礼中，这部电影获得了最佳原创音乐和最佳歌曲奖。绿野仙踪表面上看似乎仅仅是一部儿童电影，但其深刻的思想内涵却使它名列有史以来最伟大电影之列。尤其魔术师使他们实现心愿的方法发人深省。正如片头所说：“这部电影不仅仅是给儿童看的，也是给那些心境永远保持年轻的人们看的。” ','1','','0','','1','/dpic/20120725/799.jpg','112','/donghuapian/112/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/102.jpg','http://www.61baobao.com/donghuapian/pic/102.jpg','0','三个月以上','1','sohu,4732|||','0','','0','0','0');");
