E_D("replace into `phome_ecms_game` values('910','5','0','','','','1','admin','','1','0','1343189992','0','0','0','0','','','910','0','0','0','0','0','0','唐老鸭庆生记','1343189992','/spic/20120725/796.jpg','0','1','1343189992','0','3','1','0','','0','','','667','479','唐老鸭生日那天收到一份南美人寄来的一大箱生日礼物，他急忙打开来看，原来好友将南美洲热情、浪漫的生活情趣拍成一段段的录影片寄给他。影片中向往热带避寒的企鹅巴比，为了到加勒比海晒太阳，历尽千辛万苦达成心愿，却又开始想家；巴比鹦鹉带着唐老鸭来到巴西认识美丽少女丫丫，他们还一起到墨西哥与墨西哥牛仔骑士一同畅游美丽、热情的墨西哥。 详细>>','1','','0','','1','/dpic/20120725/797.jpg','132','/donghuapian/132/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/122.jpg','http://www.61baobao.com/donghuapian/pic/122.jpg','0','三个月以上','1','sohu,15272|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('911','5','0','','','','1','admin','','1','0','1343189994','0','0','0','0','','','911','0','0','0','0','0','0','阿诺狗与凯瑞猫','1343189994','/spic/20120725/800.jpg','0','1','1343189994','0','3','1','0','','0','','','667','479','《阿诺狗与凯瑞猫》系列动画片以轻松幽默的清新风格和夸张的手法，表现了阿诺狗和凯瑞猫之间的生活趣事。影片是以默片的方式呈现给观众。片中的主人公采用了狗与猫的形象。其中阿诺狗是一只长满黄褐色毛发，并且健壮魁梧的小狗。它生性顽皮，喜欢捣蛋靠着健壮身体的优势总是想比凯瑞猫厉害一点点，但却经常是适得其反，当然有时也会得到意外的胜利。凯瑞猫是一只长满蓝色毛发的大脑袋但瘦小的小猫。它很聪明，经常能够成功的作弄阿诺狗，并且幸运女神总是很眷顾它，但是运气有时也有打盹的时候。它们两人是共同生活在这个平和安宁的小镇里的伙伴和朋友。虽然它们是朋友可是由于它们在生活中总是很不安分，彼此都想战胜对方，取得每一次较量的胜利。但它们在争斗中得到的乐趣远远超过了捉弄对方，即使偶尔达成目的，结果也不知是该喜还是该悲。在它们的生活中总是充满了让人啼笑皆非的故事。','1','','0','','1','/dpic/20120725/801.jpg','625','/donghuapian/625/1.html, /donghuapian/625/2.html, /donghuapian/625/3.html, /donghuapian/625/4.html, /donghuapian/625/5.html, /donghuapian/625/6.html, /donghuapian/625/7.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0239.jpg','http://www.61baobao.com/donghuapian/pic/05/0239.jpg','0','三个月以上','7','qiyi,add64f6f0f154b5094f4bba248f7f3cc|||qiyi,0cd7316aee9d426196295cc668eb171f|||qiyi,a94a600a273945c5be595edcf028f93b|||qiyi,1b8bf9ac4e15482a97f2274734358e3c|||qiyi,c934528239b543f2a89c6c4e2eb36975|||qiyi,e5b3d69f339e4fdd94032bec5680956d|||qiyi,ab827b8b8e12479182f18eeca657a8e7|||','0','','0','0','0');");
